import React from 'react';
import { useNavigate } from 'react-router-dom';


const EmployeeList = () => {
  const navigate = useNavigate();
  return (
    <div>
      <h1>Employee List</h1>
      <button onClick={() => navigate('/register-employee')}>New Employee</button>
      <button onClick={() => navigate('/employees')}>New Employee</button>
    </div>
  );
};

export default EmployeeList;
